import styled from "styled-components";

const Btn = styled.button`
  padding: 8px 16px;
  background-color: #f38c29;
  color: #142610;
  border: none;
  cursor: pointer;
  padding: 15px;
`;

export const ButtonComponent = ({ text, onClick }) => {
  return (
    <ButtonContainer onClick={onClick}>
      <span>{text}</span>
    </ButtonContainer>
  );
};




export default Button;
